import React from "react";
import Header from "./components/Heading";

class Greeting {
  render() {
    const date = new Date();
    const hour = date.getHours();
    let timeOfDay;
    hour % 12 < 12
      ? (timeOfDay = "Morning")
      : hour % 12 > 17
      ? (timeOfDay = "Night")
      : (timeOfDay = "Afternoon");

    return (
      <div>
        <p>Good {timeOfDay}</p>
      </div>
    );
  }
}

export default class Map {
  render() {
    return (
      <div>
        <Header item={{ username: "jishnu" }} />
        <Greeting />
        <h1>hihihih</h1>
      </div>
    );
  }
}
